import React, { useState } from 'react';
import './index.css';



function Time (){
    var a = new Date();
    var [hour,run]=useState(a.getHours);
    var [minute,run1]=useState(a.getMinutes);
    var [second,run2]=useState(a.getSeconds);
    function Click(){
        
            a = new Date();
            run(a.getHours);
            run1(a.getMinutes);
            run2(a.getSeconds);
        
    }
    // setInterval(Click,1000);
    return (
        <>
        <Nav/>
        <h1 className="number"><span>{hour}</span>:<span>{minute}</span>:<span>{second}</span>  <span>{"PM"}</span></h1>
            <button onClick={Click} className="button">
                Click Me
            </button>
        </>
    );
}

function Nav(){
    return (
     <div className="nav">
         <h2>List of my favourate webseries</h2>
     </div>
 );
 }


function App(){
    return(
        <>
        <Nav/>
        <Time/>
        </>
    );
}
export default App;
